#[test]
fn test_integer_literal_in_notebook() { let mut notebook = Notebook::new(); let result = notebook.execute_cell("42"); assert_eq!(result, "42");
} #[test]
fn test_float_literal_in_notebook() { let mut notebook = Notebook::new(); let result = notebook.execute_cell("3.14"); assert_eq!(result, "3.14");
} #[test]
fn test_string_literal_in_notebook() { let mut notebook = Notebook::new(); let result = notebook.execute_cell("\"hello\""); assert_eq!(result, "\"hello\"");
}
